// funcin para asignar una cookie aleatoria para la llamada del array de cookies
function randomCookieSetter(){
    let randomNumCookie = Math.floor(Math.random() * cookies.length);
    col.item[0].request.header[1].value = cookies[randomNumCookie];
    return
}

// funcin para obtener un nmero de milisegundos aleatorio para dejar tiempo entre llamadas
function randomNumber(){
    let randomNum = Math.floor((Math.random() * 4000) + 1500);
    return randomNum;
}

export async function runIteration() {
    // variables que manejan que pgina se llama de la API junto con variable donde se almacenan los datos
    const maxIterations = 50;
    let currentIteration = 1;
    let globalResponses = [];
    while (currentIteration <= maxIterations) {
        console.log("obteniendo datos de pgina:", currentIteration);
        env.values[0].value = currentIteration;
        randomCookieSetter();
        try {
            await new Promise((resolve, reject) => {
                newman.run({
                    collection: col,
                    environment: env,
                    iterationCount: 1
                })
                .on('done', function (err, summary) {
                    if (err) {
                        console.error("Error al ejecutar la coleccin:", err);
                        reject(err);
                        return;
                    }

                    summary.run.executions.forEach(exec => {
                        if (exec.response && exec.response.stream) {
                            try {
                                const responseBody = JSON.parse(exec.response.stream.toString());
                                if (responseBody.data && Array.isArray(responseBody.data.items)) {
                                    responseBody.data.items.forEach(item => {
                                        let resultantName = item.name.replace(" PC", "");
                                        let resultantBasePrice = parseFloat(parseFloat(item.price.amount).toFixed(2));
                                        if (!item.path.includes("account")) {
                                            globalResponses.push({
                                                path: item.path,
                                                name: resultantName,
                                                basePrice: resultantBasePrice
                                            });
                                        }
                                    });
                                }
                            } catch (error) {
                                console.error(`Error procesando respuesta de ${exec.item.name}:`, error);
                                const contentType = exec.response.headers.get('Content-Type');
                                const responseText = exec.response.stream.toString();
                                if (!contentType.includes('application/json')) {
                                    console.error(`Respuesta no JSON en ${exec.item.name}:`, responseText.substring(0, 100));
                                    return;
                                }
                            }
                        }
                    });

                    console.log(`Iteracin ${currentIteration} completada.`);
                    currentIteration++;
                    resolve();
                });
            });

            // Introduce delay before next iteration
            if (currentIteration <= maxIterations) {
                await new Promise(resolve => setTimeout(resolve, randomNumber()));
            }

        } catch (error) {
            console.error("Error en la iteracin:", error);
            break;
        }
    }

    // Save results after finishing iterations
    // fs.writeFileSync('responses.json', JSON.stringify(globalResponses, null, 2), 'utf8');
    // console.log('Archivo responses.json generado con los datos filtrados.');
    
    return globalResponses;
}
